import React from 'react';
import { Box, Typography, List, ListItem, ListItemIcon, ListItemText, Button, Divider } from '@mui/material';
import { useNavigate, useLocation } from 'react-router-dom';
import DashboardIcon from '@mui/icons-material/Dashboard';
import EventIcon from '@mui/icons-material/Event';
import PeopleIcon from '@mui/icons-material/People';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import NotificationsActiveIcon from '@mui/icons-material/NotificationsActive';
import SettingsIcon from '@mui/icons-material/Settings';
import './Sidebar.css';

const Sidebar = () => {
  const navigate = useNavigate();
  const location = useLocation();

  const menuItems = [
    { 
      text: 'Dashboard', 
      icon: <DashboardIcon />, 
      path: '/dashboard',
      onClick: () => navigate('/dashboard')
    },
    { 
      text: 'My Events', 
      icon: <EventIcon />, 
      path: '/events',
      onClick: () => navigate('/events') 
    },
    { 
      text: 'Calendar', 
      icon: <CalendarMonthIcon />, 
      path: '/calendar',
      onClick: () => navigate('/calendar')
    },
    { 
      text: 'Attendees', 
      icon: <PeopleIcon />, 
      path: '/attendees',
      onClick: () => navigate('/attendees')
    },
    { 
      text: 'Notifications', 
      icon: <NotificationsActiveIcon />, 
      path: '/notifications',
      onClick: () => navigate('/notifications')
    },
    { 
      text: 'Settings', 
      icon: <SettingsIcon />, 
      path: '/settings',
      onClick: () => navigate('/settings')
    }
  ];

  return (
    <Box className="sidebar" sx={{ 
      background: 'linear-gradient(180deg, #14071a 0%, #0f0617 100%)',
      borderRight: '1px solid rgba(255, 31, 142, 0.2)',
      position: 'relative',
      overflow: 'hidden'
    }}>
      {/* Neon hexagon background element */}
      <div className="sidebar-hexagon"></div>

      <Box className="sidebar-header" sx={{ position: 'relative', zIndex: 5 }}>
        <Typography variant="h5" className="app-title" sx={{ 
          color: '#ff1f8e', 
          fontWeight: 'bold',
          display: 'flex',
          alignItems: 'center',
          textShadow: '0 0 10px rgba(255, 31, 142, 0.5)'
        }}>
          <span style={{ fontSize: '1.7rem', marginRight: '8px' }}>🎉</span> Eventify
        </Typography>
      </Box>

      <Divider className="sidebar-divider" sx={{ 
        borderColor: 'rgba(255, 31, 142, 0.2)',
        margin: '1rem 0'
      }} />

      <List component="nav" className="sidebar-nav" sx={{ position: 'relative', zIndex: 5 }}>
        {menuItems.map((item) => (
          <ListItem 
            button 
            key={item.text} 
            onClick={item.onClick}
            className={location.pathname === item.path ? "sidebar-item-active" : "sidebar-item"}
            sx={{
              margin: '0.3rem 0',
              borderRadius: '8px',
              transition: 'all 0.3s ease',
              '&.sidebar-item-active': {
                backgroundColor: 'rgba(255, 31, 142, 0.15)',
                backdropFilter: 'blur(5px)',
                '& .sidebar-icon': {
                  color: '#ff1f8e'
                },
                '& .MuiTypography-root': {
                  color: '#ff1f8e',
                  fontWeight: 'bold'
                }
              },
              '&:hover': {
                backgroundColor: 'rgba(255, 31, 142, 0.08)',
                '& .sidebar-icon': {
                  color: '#ff1f8e'
                }
              }
            }}
          >
            <ListItemIcon className="sidebar-icon" sx={{ 
              color: 'rgba(255, 255, 255, 0.7)',
              minWidth: '42px'
            }}>
              {item.icon}
            </ListItemIcon>
            <ListItemText primary={item.text} />
          </ListItem>
        ))}
      </List>

      <Box className="sidebar-footer" sx={{ 
        position: 'relative', 
        zIndex: 5,
        padding: '1rem'
      }}>
        <Button 
          variant="contained" 
          color="secondary" 
          fullWidth 
          startIcon={<EventIcon />}
          onClick={() => navigate('/create-event')}
          className="create-event-button"
          sx={{
            background: 'linear-gradient(45deg, #ff1f8e 30%, #ff758c 90%)',
            boxShadow: '0 4px 20px 0 rgba(255, 31, 142, 0.5)',
            borderRadius: '30px',
            padding: '0.8rem',
            fontWeight: 'bold',
            '&:hover': {
              boxShadow: '0 6px 25px rgba(255, 31, 142, 0.7)'
            }
          }}
        >
          CREATE EVENT
        </Button>

        <Box sx={{ mt: 4 }}>
          <Typography variant="body2" className="sidebar-footer-text" sx={{ 
            color: '#ff1f8e',
            textAlign: 'center',
            fontWeight: 'bold'
          }}>
            Event Management Made Simple
          </Typography>
          <Typography variant="caption" className="sidebar-footer-text" sx={{ 
            color: 'rgba(255, 255, 255, 0.7)',
            textAlign: 'center',
            display: 'block'
          }}>
            Create, Manage and Track events with our feature platform
          </Typography>
        </Box>
      </Box>
    </Box>
  );
};

export default Sidebar;
